import React, { Component } from 'react';
import '../../assets/css/home/homeRankingICC.css';

class RankingContentsIdentifire extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  renderRanking = data => {
    return (
      <div>
        {data.map((player, i) => (
          <div key={i}>
            <div key={i} className="card mycard p-2 text-center">
              <div className="card-title">
                <img
                  className="img"
                  src={player.player_display_picture}
                  alt="noImage"
                />
              </div>

              <div className="card-title home-ranking-title-bold">
                <span className="player-rating-number">{player.rating}</span>{" "}
                <p>Rating</p>
                {i + 1} {" - "} {player.player_name} <br />
                {player.team_name}
              </div>
            </div>
          </div>
        ))}
      </div>
    );
  };

  render() {
    const { contents } = this.props;

    if (!contents.data) return "";

    return (
      <div className="card p-3 mb-2">
        <h6> ICC RANKING</h6>
        <hr />

        <h6 className="card-title">ALL ROUNDERS</h6>
        <div className="card-columns">
          {this.renderRanking(contents.data.odi.all_rounder)}

          {/* {contents.data.odi.all_rounder.map(
                (rank_odi_AllRounder, i) => (
                  <div key={i}>
                    <div
                      key={i}
                      className="card mycard p-2 text-center"
                    >
                      <div className="card-title">
                        <img
                          className="img"
                          src={
                            rank_odi_AllRounder.player_display_picture
                          }
                          alt="noImage"
                        />
                      </div>

                      <div className="card-title home-ranking-title-bold">
                        <span className="player-rating-number">
                          {rank_odi_AllRounder.rating}
                        </span>{" "}
                        <p>Rating</p>
                        {i + 1} {" - "}{" "}
                        {rank_odi_AllRounder.player_name} <br />
                        {rank_odi_AllRounder.team_name}
                      </div>
                    </div>
                  </div>
                ))} */}
        </div>

        <h6 className="card-title">BOWLERS</h6>
        <div className="card-columns">
        {this.renderRanking(contents.data.odi.bowler)}
          {/* {contents.data.odi.bowler.map((rank_odi_Bowler, i) => (
            <div key={i}>
              <div key={i} className="card mycard p-2 text-center">
                <div className="card-title">
                  <img
                    className="img"
                    src={rank_odi_Bowler.player_display_picture}
                    alt="noImage"
                  />
                </div>

                <div className="card-title home-ranking-title-bold">
                  <span className="player-rating-number">
                    {rank_odi_Bowler.rating}
                  </span>{" "}
                  <p>Rating</p>
                  <span className="home-ranking-player-name">
                    {i + 1} {" - "} {rank_odi_Bowler.player_name}
                  </span>{" "}
                  <br /> {rank_odi_Bowler.team_name}
                </div>
              </div>
            </div>
          ))} */}
        </div>

        <h6 className="card-title">BATSMEN</h6>

        <div className="card-columns">
        {this.renderRanking(contents.data.odi.batsmen)}
          {/* {contents.data.odi.batsmen.map((rank_odi_Batsman, i) => (
            <div key={i}>
              <div key={i} className="card mycard p-2 text-center">
                <div className="card-title">
                  <img
                    className="img"
                    src={rank_odi_Batsman.player_display_picture}
                    alt="noImage"
                  />
                </div>

                <div className="card-title home-ranking-title-bold">
                  <span className="player-rating-number">
                    {rank_odi_Batsman.rating}
                  </span>
                  <p>Rating</p>
                  <span className="home-ranking-player-name">
                    {i + 1} {" - "} {rank_odi_Batsman.player_name}
                  </span>{" "}
                  <br /> {rank_odi_Batsman.team_name}
                </div>
              </div>
            </div>
          ))} */}
        </div>
      </div>
    );
  }
}


export default RankingContentsIdentifire;
